import React from "react";

class BurgerCart extends React.Component {
    constructor(props) {
        super(props)
    }
    render () {

        return (
            <>
                <p>{this.props.name}</p>
                <img src={this.props.image}></img>
            </>
        )
    }
}

export default BurgerCart
